message:
🇧🇷O  PRESIDENTE BOLSONARO FOI REELEITO NO PRIMEIRO TURNO COM LARGA VANTAGEM À FRENTE DO LULA 🇧🇷

A FRAUDE FOI  *SISTÊMICA*. 
*Não foi só na urna e nem só na apuração, e sim em TODO O PROCESSO, desde o início. Lula foi só uma peça desse sistema.*
 *Vejam:*
*01.* Em 21/03/19, um grupo de juízes federais e desembargadores viajou a Curitiba para manifestar apoio e solidariedade ao então preso Lula, participando da chamada “vigília Lula livre”. Você já viu um negócio desses? Juízes sensibilizados com um ladrão preso? Veja o desfecho que isso tudo daria;
*02.* Para derrubar Bolsonaro, era necessário um oponente. Por isso,  tiraram Lula da cadeia, anularam a sua condenação e devolveram seus direitos políticos, tornado-o elegível;
*03.* Impediram toda e qualquer ação que garantisse transparência na votação e na apuração, o tão discutido voto auditável. Ponto alto disso foi a ida dos ministros Barroso e Alexandre de Moraes até a câmara federal para pressionar a troca dos presidentes de comissão, o que foi decisivo para o projeto não passar. Nesse dia foi gravada aquela triste passagem com a fala eternizada “eleição não se ganha, se toma”;
*04.* Ampliaram o poder do TSE, concentrando autoridade na mão de apenas um homem: Alexandre de Moraes. Carmen Lúcia entrou para a história em voto recente quando reconheceu a inconstitucionalidade da censura, mas  lavou as mãos. Nem ela  teve força para ir contra o Sistema;
*05.* Ainda não sabemos como, mas o Sistema calou/amordaçou os ministros Nunes Marques e André Mendonça;
*06.* Alexandre de Moraes garantiu que a propaganda eleitoral em rádio (fundamental especialmente no Nordeste) fosse fraudada  em benefício de Lula, em no mínimo 154 mil inserções a menos para Bolsonaro; 
*07.* Globo, Estadão, Folha e UOL montaram e lideraram um pool de mídia favorável a Lula, garantindo 24 hs diárias de propaganda e mentiras contra Bolsonaro;
*08.* Alexandre de Moraes liderou uma ampla rede de vigilância contra a boa informação, fazendo censura prévia  em veículos de comunicação, decretando prisões de oficio, desmonetização de canais e perseguição de ativistas e apoiadores de Bolsonaro. A Jovem Pan viveu dias de censura;
*09.* A Justiça Eleitoral nos Estados entrou na fraude sistêmica, vigiando até a militância voluntária, mandando retirar cartazes, outdoors, adesivos de carros, até a bandeira brasileira teve seu uso cerceado;
*10.* Enquanto a campanha de Bolsonaro era cerceada de todos os lados, Lula seguia livre, fazendo tudo o que Bolsonaro não podia fazer, inclusive manifestações com traficantes armados no RJ;
*11.* Alexandre de Moraes tornou-se um ativista político a serviço do PT, atendendo todo e qualquer pedido da campanha petista.
*12.* Bolsonaro e suas mídias foram proibidas até de falar verdades como Lula foi condenado, Lula não foi inocentado, Lula tem ligação com facções criminosas e que Lula foi o chefe de organização criminosa;
*13.* A PM foi impedida de fazer operações contra traficantes, a PRF foi impedida de fiscalizar  boca de urna e compra de votos, a PF foi impedida de investigar pesquisas fraudulentas;
*14.* Os institutos de pesquisa manipularam números ao bel prazer, com amplo e potente apoio da grande mídia, o que com certeza teve grande impacto na votação, especialmente no primeiro turno;
*15.* Redes sociais foram vigiadas, canais desmonetizados, contas foram bloqueadas e influenciadores foram silenciados; 
*16.* Câmara e Senado Federal calaram-se diante de todos os descalabros judiciais praticados pelo TSE.
*CONCLUSÃO: Nem Jair nem ninguém seria capaz de vencer uma eleição assim.*
*A FRAUDE FOI SISTÊMICA! ESSA ELEIÇÃO FOI ILEGÍTIMA*
